import React from 'react'
import Home from './Home'
import Quiz from './Quiz'

export default function App() {
  
  let start = false
  function newGame() {
    start = true
  }

  return (
    <>
      {start ? <Quiz /> : <Home newGame={newGame}/>}
    </>
  )
}
